lbar y cantar en la ducha o cuando estoy sola'),(29,'Soy bueno(a) para el atletismo.'),(30,'Me gusta escribir cartas detalladas a mis amigos.'),(31,'Generalmente me doy cuenta de la expresión que tengo en la cara'),(32,'Me doy cuenta de las expresiones en la cara de otras personas.'),(33,'Me mantengo \"en contacto\" con mis estados de ánimo. No me cuesta identificarlos.'),(34,'Me doy cuenta de los estados de ánimo de otros.'),(35,'Me doy cuenta bastante bien de lo que otros piensan de mí');
